{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPyBkck/WiAptH07SmCsiaL"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":null,"metadata":{"id":"dmkxpytzwox2"},"outputs":[],"source":["import random\n","import numpy as np\n","\n","class KMeans:\n","    def __init__(self,n_clusters=2,max_iter=100):\n","        self.n_clusters = n_clusters\n","        self.max_iter = max_iter\n","        self.centroids = None\n","\n","    def fit_predict(self,X):\n","\n","        random_index = random.sample(range(0,X.shape[0]),self.n_clusters)\n","        self.centroids = X[random_index]\n","\n","        for i in range(self.max_iter):\n","            # assign clusters\n","            cluster_group = self.assign_clusters(X)\n","            old_centroids = self.centroids\n","            # move centroids\n","            self.centroids = self.move_centroids(X,cluster_group)\n","            # check finish\n","            if (old_centroids == self.centroids).all():\n","                break\n","\n","        return cluster_group\n","\n","    def assign_clusters(self,X):\n","        cluster_group = []\n","        distances = []\n","\n","        for row in X:\n","            for centroid in self.centroids:\n","                distances.append(np.sqrt(np.dot(row-centroid,row-centroid)))\n","            min_distance = min(distances)\n","            index_pos = distances.index(min_distance)\n","            cluster_group.append(index_pos)\n","            distances.clear()\n","\n","        return np.array(cluster_group)\n","\n","    def move_centroids(self,X,cluster_group):\n","        new_centroids = []\n","\n","        cluster_type = np.unique(cluster_group)\n","\n","        for type in cluster_type:\n","            new_centroids.append(X[cluster_group == type].mean(axis=0))\n","\n","        return np.array(new_centroids)\n"]},{"cell_type":"code","source":["from sklearn.datasets import make_blobs\n","import matplotlib.pyplot as plt\n","import pandas as pd\n","\n","#centroids = [(-5,-5),(5,5),(-2.5,2.5),(2.5,-2.5)]\n","#cluster_std = [1,1,1,1]\n","\n","#X,y = make_blobs(n_samples=100,cluster_std=cluster_std,centers=centroids,n_features=2,random_state=2)\n","\n","#plt.scatter(X[:,0],X[:,1])\n","\n","df = pd.read_csv('student_clustering.csv')\n","\n","X = df.iloc[:,:].values\n","\n","km = KMeans(n_clusters=4,max_iter=500)\n","y_means = km.fit_predict(X)\n","\n","plt.scatter(X[y_means == 0,0],X[y_means == 0,1],color='red')\n","plt.scatter(X[y_means == 1,0],X[y_means == 1,1],color='blue')\n","plt.scatter(X[y_means == 2,0],X[y_means == 2,1],color='green')\n","plt.scatter(X[y_means == 3,0],X[y_means == 3,1],color='yellow')\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":430},"id":"6rkYsqp_YTpk","executionInfo":{"status":"ok","timestamp":1771848230708,"user_tz":-330,"elapsed":2601,"user":{"displayName":"Arnav Tomar","userId":"05362157737552244045"}},"outputId":"50bef2c9-9deb-48cc-ec62-c9d61161d405"},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]}]}